             "enablevirtualstick",
             "open the virtual stick mode. <b>note:  1. for flight safety, when the aircraft is close(about 30 meters) to the restricted flight zone or restricted distance, the remote controller will get the control of the aircraft, and the virtual stick cannot be used.  2. currently, only m300 rtk, m350 rtk and m30 series aircraft support obstacle avoidance in virtual joystick mode.  3. the virtual stick normal mode supports obstacle avoidance by default.  4. in the virtual stick advanced mode, obstacle avoidance is supported only when the vertical control mode is velocity mode, the  yaw control mode is angular velocity mode, and the roll pitch control mode is velocity mode. </b> <i>supported since msdk 5.0.0</i></code>  @param callback return the callback of execution result.",
