             "keyrcfirmwareinfo",
             "get the current firmware information of the remote controller. <i>supported since msdk 5.4.0</i></code>",
             "keyswitchrcfirmware",
             "switch the remote controller firmware type. take dji rc plus remote controller as an example: dji rc plus remote controller can be used for m30 series, m300 rtk and m350 rtk. you can call this interface to switch the firmware of different aircraft, and then call `keyrequestpairing` for pairing. <i>supported since msdk 5.4.0</i></code>",
             "keyrequestpairing",
             "start the remote controller pairing operation, then the remote controller will start pairing with the aircraft. when the remote controller cannot be connected to the aircraft or the remote controller is replaced, the remote controller can be connected to the aircraft through pairing operation. <b>note: dji rc plus remote controller and dji rc n1 remote controller support multiple aircraft types. please first call `keyrcfirmwareinfo` to get the firmware type of the current remote controller. if the firmware type is inconsistent with the type of aircraft that needs to be paired, please call `keyswitchrcfirmware` to switch the firmware of the remote controller to the type that needs to be paired before performing the pairing operation. </b> <i>supported since msdk 5.4.0</i></code>",
