             "remove all listeners of waypoint action execution. <i>supported since msdk 5.6.0</i></code>",
             "pushkmzfiletoaircraft",
             "upload a waypoint mission. - the waypoint mission is defined in a kmz file, kmz file is defined according to the dji standard wpml. the wpml is defined according to xml and kml. for more details, please see: <a href=https://developer.dji.com/doc/cloud-api-tutorial/en/api-reference/dji- wpml/overview.html>dji wpml</a>.  - users can generate a kmz file according to the template provided by dji pilot 2. you can also define custom waylines.wpml according to dji wpml standard and upload it after compressing it into a kmz file.  - the newly uploaded kmz file will override the previously uploaded kmz file if they have the same mission kmz file name.  - you can call this interface multiple times to upload multiple waypoint mission kmz files. you can set mission kmz file name to select the mission to start`startmission` or stop`stopmission`.  - one kmz file includes one waypoint mission. one waypoint mission can contain multiple waylines. <i>supported since msdk 5.0.0</i></code>  @param missionfilepath the file path of the waypoint mission kmz file. @param callback return the execution result. return the upload status of the kmz file including uploading progress and errors.",
             "startmission",
             "start the waypoint mission. <i>supported since msdk 5.0.0</i></code>  @param missionfilename the file name of the mission to be executed. @param callback return the execution result.",
             "getavailablewaylineids",
             "returns a list of wayline ids available in the specified mission file. after obtaining this wayline id list, you can select the wayline id to be executed and pass it as a parameter to `startmission` to execute the waypoint mission. <i>supported since msdk 5.1.0</i></code>  @param missionfilename the specified mission filename.  @return get a list of wayline ids available in the specified mission file.",
             "startmission",
             "start executing the waypoint mission of the specified wayline ids list. a list of available wayline ids can be obtained through `getavailablewaylineids`, after obtaining this wayline ids list, you can select the wayline id to be executed as a parameter and pass it to this interface, the aircraft will execute the waypoint mission in sequence in the order of the wayline ids list. if the wayline ids list parameter is empty or the length of the wayline ids list is 0, the aircraft will execute all waylines in the waypoint mission. <i>supported since msdk 5.1.0</i></code>  @param missionfilename the file name of the mission to be executed. @param waylineids the wayline ids list to be executed. @param callback return the execution result.",
             "querybreakpointinfofromaircraft",
             "query the breakpoint information when the waypoint mission is paused. the breakpoint information includes the position of the aircraft where the waypoint mission is paused. after the breakpoint information is obtained, it can be passed as a parameter to `startmission` or `resumemission` to execute the waypoint mission. the aircraft will fly to the incoming breakpoint position, and then execute the waypoint mission in sequence according to the waypoint order. <b>note:  1. the m300 rtk and m350 rtk do not support the breakpoint function.  2. the breakpoint information can only be queried after calling the pause waypoint mission interface `pausemission`. </b> <i>supported since msdk 5.6.0</i></code>  @param missionfilename the file name of the mission to be executed. @param callback return the execution result.",
             "startmission",
             "start executing the waypoint mission at the specified breakpoint. you can use `querybreakpointinfofromaircraft` to query the breakpoint information when the last waypoint mission was suspended. after the breakpoint information is obtained, it can be passed as a parameter to this interface, and the aircraft will fly to the incoming breakpoint position, and then execute waypoint mission in sequence according to the waypoint order. if you don't want to start the waypoint mission from the position of the aircraft when it was paused last time, you can also construct the breakpoint information by yourself and set any waypoint position to start the waypoint mission. <b>note:  1. the m300 rtk and m350 rtk do not support the breakpoint function.  2. after suspending the waypoint mission, this interface can be called to re- execute the waypoint mission only after exiting the waypoint mission. common application scenarios include: return and land after the flight mission is completed or the aircraft is powered on again.  3. if you want to start flying from the specified breakpoint without exiting the waypoint mission. you can call `resumemission` to resume execution of the waypoint mission. </b> <i>supported since msdk 5.6.0</i></code>  @param missionfilename the file name of the mission to be executed. @param breakpointinfo breakpoint information of the mission to be executed. @param callback return the execution result.",
             "pausemission",
             "pause the waypoint mission. <i>supported since msdk 5.0.0</i></code>  @param callback return the execution result.",
             "resumemission",
             "resume the waypoint mission from the pause point. <i>supported since msdk 5.0.0</i></code>  @param callback return the execution result.",
             "resumemission",
             "resume execution of the waypoint mission from the specified breakpoint. you can query the breakpoint information when the waypoint mission is paused through `querybreakpointinfofromaircraft`. after the breakpoint information is obtained, it can be passed as a parameter to this interface, and the aircraft will fly to the incoming breakpoint position, and then execute waypoint mission in sequence according to the waypoint order. if you don't want to start the waypoint mission from the position of the aircraft when it was paused last time, you can also construct the breakpoint information by yourself and set any waypoint position to start the waypoint mission. <b>note:  the m300 rtk and m350 rtk do not support the breakpoint function. </b> <i>supported since msdk 5.6.0</i></code>  @param breakpointinfo the breakpoint information needed to resume execution. @param callback return the execution result.",
