                   "Delete the media file in camera. After calling this interface, media file list status `MediaFileListState` will change to `UPDATING`. After the deletion, the media file list status `MediaFileListState` is `UP_TO_DATE`, please call `getMediaFileListData` to update media file list data. <i>Supported since MSDK 5.0.0</i></code>  @param files Media file list that needs to be deleted. @param callback Return the execution result of callback.",
