                   "KeyExposureMode",
                   2,
                   "/Components/IKeyManager/Key_Camera_CameraKey.html",
                   "#Key_Camera_ExposureMode_inline",
                   "<b>Parameter:</b>`CameraExposureMode`  To set the exposure mode of the selected lens. The exposure mode decides whether the aperture, shutter speed and ISO can be set automatically or manually. The settable exposure mode can be obtained through `KeyExposureModeRange`. When `CameraVideoStreamSourceType` is `INFRARED_CAMERA`, exposure mode can not be set. <b>Note:  1. Exposure mode settings can only be performed on the lens of the current liveview stream source, otherwise the settings will be unsuccessful.  2. You could obtain the liveview camera source through `KeyCameraVideoStreamSource`. Then set the `CameraLensType` with the current liveview camera source when the `DJIKey<T>` instance was created using `KeyTools`.  3. In the super resolution photo mode, the exposure mode cannot be set. </b> <i>Supported since MSDK 5.0.0</i></code>",
