                   "#Key_Camera_CameraMeteringMode_inline",
                   "<b>Parameter:</b>`CameraMeteringMode`  To set metering mode of camera lens. If you want to use center metering or average metering function, you only need to set `CENTER` or `AVERAGE` once, the lens will operate metering once. If you want to use spot or area metering function, `KeySpotMeteringPoint` or `KeyRegionMeteringArea` should be called to set meiering parameters, and the lens will perform spot or area metering once.  <b>Caution: If you want to use metering function, please use `KeyExposureMode` to set the exposure mode to `PROGRAM`, `SHUTTER_PRIORITY` or `APERTURE_PRIORITY`, and call `KeyAELockEnabled` to set AE Lock to `false`. </b> <i>Supported since MSDK 5.2.0</i></code>",
