                   "#Key_Camera_CameraThermalIsothermUnit_inline",
                   "<b>Parameter: </b>`ThermalIsothermUnit`  Units for isotherms. Sets the unit of the Isotherm ranges to either Celsius or percent. Different units results in different value ranges for Isotherms. If the unit is percent, the settable value range is [0,100]. If the unit is Celsius, the settable upper value and lower value can refer to `KeyThermalGainModeTemperatureRange`. <b>Notice  1. To use this function, please call `KeyCameraVideoStreamSource` to set the video source to `INFRARED_CAMERA`.  2. When using `KeyTools` to create a `DJIKey<T>` instance, please set `CameraLensType` to `CAMERA_LENS_THERMAL`. </b> 3. H20 series cameras do not support setting isotherm units.</b> <i>Supported since MSDK 5.0.0</i></code>",
